content=Lay on thy whips, O Love, that we upright, / Poised on the perilous point, in no lax bed / May sleep, as tension at the verberant core / Of music sleeps; for, if thou spare to smite, / Staggering, we stoop, stooping, fall dumb and dead, / And, dying so, sleep our sweet sleep no more.

